package com.markelytics.android.model;/** * Created by dvimay on 10/12/15. */public class RedeemRewards {    String method_id, method_name, min_threshold,max_threshold, unit_cost, title_text, below_amount, over_amount, confirm_text;    public String getMethod_name() {        return method_name;    }    public void setMethod_name(String method_name) {        this.method_name = method_name;    }    public String getMin_threshold() {        return min_threshold;    }    public void setMin_threshold(String min_threshold) {        this.min_threshold = min_threshold;    }    public void setMax_threshold(String max_threshold) {        this.max_threshold = max_threshold;    }    public String getUnit_cost() {        return unit_cost;    }    public void setUnit_cost(String unit_cost) {        this.unit_cost = unit_cost;    }    public String getTitle_text() {        return title_text;    }    public void setTitle_text(String title_text) {        this.title_text = title_text;    }    public String getBelow_amount() {        return below_amount;    }    public void setBelow_amount(String below_amount) {        this.below_amount = below_amount;    }    public String getOver_amount() {        return over_amount;    }    public void setOver_amount(String over_amount) {        this.over_amount = over_amount;    }    public String getConfirm_text() {        return confirm_text;    }    public void setConfirm_text(String confirm_text) {        this.confirm_text = confirm_text;    }    public String getMethod_id() {        return method_id;    }    public void setMethod_id(String method_id) {        this.method_id = method_id;    }}